import React, {useState, useEffect, useRef, createRef} from 'react';

const playButton = "https://res.cloudinary.com/dr33x9zki/image/upload/v1598622742/playButton_wbklh0.svg";
const pauseButton = "https://res.cloudinary.com/dr33x9zki/image/upload/v1598622552/pauseButton_uaevyc.svg";
const rainLogo = "https://res.cloudinary.com/dr33x9zki/image/upload/v1598622934/rainLogo_l5hfcz.svg";
const sunnyLogo = "https://res.cloudinary.com/dr33x9zki/image/upload/v1598622934/sunnyLogo_nlmdx5.svg";
const soundRain ="https://res.cloudinary.com/dr33x9zki/video/upload/v1598614368/rain_0fba65ae95.mp3";
const soundBeach ="https://res.cloudinary.com/dr33x9zki/video/upload/v1598614376/beach_5f8a65a2b3.mp3";
const videoRain ="https://res.cloudinary.com/dr33x9zki/video/upload/v1598614073/rain_3d36b982bd.mp4";
const videoBeach ="https://res.cloudinary.com/dr33x9zki/video/upload/v1598614072/beach_86806ea5ca.mp4";

const loading = "url('data:image/gif;base64,')"

let timer;

const Bonus = () => {
  //const [audio] = useState(new Audio(videoRain));
  const [playStatus, updatePlayStatus] = useState (false);
  const [pauseStatus, updatePauseStatus] = useState (true);
  const [playing, setPlaying] = useState(false);
  const [isLoading, changeIsLoading] = useState(false);

  const audioElement = useRef(null);
  const videoElement =useRef(null);
  const [mood, setMood] = useState('soundBeach');
  const [media, setMedia] = useState(videoBeach)
  const [secondsLeft, setSecondsLeft] = useState(0);


  const toggle = () => setPlaying(!playing);

  const onLoadStartHandler = event => {
    console.log("onLoadStartHandler");
    changeIsLoading(true);
  };

  const onCanPlayHandler = () => {
    console.log("onCanPlayHandler");
    changeIsLoading(false);
  };

  console.log("videoElemen",videoElement)
  console.log("isLoading", isLoading)


  useEffect(() => {
    if (videoElement.current ) {
      const element = videoElement.current;
      element.addEventListener("loadstart", onLoadStartHandler);

      element.addEventListener("canplay", onCanPlayHandler);
    }

    return () => {
      if (videoElement.current ) {
        const element = videoElement.current;
        element.removeEventListener("loadstart", onLoadStartHandler);

        element.removeEventListener("canplay", onCanPlayHandler);
      }
    };
  }, [media]);

  const styleLoading = {
    backgroundColor: isLoading ? "blue" : null,
    backgroundImage: isLoading ? `${loading}`  : null,
    backgroundPosition: isLoading ? "center top" : null,
    backgroundRepeat: isLoading ? "no-repeat": null,
    height: isLoading ? "100vh" : null
  };

  useEffect(() => {
    if (audioElement.current) {
      if (playing) {
        audioElement.current.play();
        videoElement.current.play()
      } else {
        audioElement.current.pause();
        videoElement.current.pause()
      }
    }
  }, [playing, mood]);

  const setTimer = minutes => () => {
    setSecondsLeft(minutes * 60 * 1000);
  };

  const mm = Math.floor(secondsLeft / 1000 / 60);
  const ss = ("0"+ Math.floor((secondsLeft / 1000) % 60)).slice(-2);

  useEffect(() => {
    clearInterval(timer);
    timer = setInterval(() => {
      if (playing) {
        //console.log("playing");

        if (secondsLeft - 1000 >= 0) {
          setSecondsLeft(secondsLeft - 1000);
        } else {
          setPlaying(false)
          //console.log("not playing");
        }
      }
    }, 1000);

    return () => {
      clearInterval(timer);
    };
  }, [playing, secondsLeft]);

  const onClickRain = () => {
    setMood(soundRain)
    setMedia(videoRain)
  }

  const onClickBeach = () => {
    setMood(soundBeach)
    setMedia(videoBeach)
  }

  return (

      <div className="bonus">{/*bonus-container*/}
        <div className="container-fluid pl-0">
            <div className="" style= {{
              backgroundImage: isLoading ? `${loading}`  : null,
              backgroundPosition: "top",
              backgroundRepeat: "no-repeat",
              height: "100%",
              position: "absolute",
              zIndex: "0",
              top: "0",
              width:"100%",
              marginTop: "-190px"
              }}>
            </div>
            <video className="" loop ref ={videoElement} key ={media} style = {{
              position: "absolute",
              zIndex: "0",
              top: "0",
              width:"100%",
              height:"100%",
              objectFit: "cover",
              opacity:"1"}}>
              <source src={`${media}`}  type="video/mp4"/>
            </video>
            <audio ref={audioElement} key={mood}>
              {/* <source src="melody.ogg" type="audio/ogg" /> */}
              <source src={`${mood}`} type="audio/mpeg" />
            </audio>
          <div className="row justify-content-around">
            <div className="col offset-0 ml-4">
                <div className="row justify-content-center my-5 ">
                    <button className="btn btn-lg btn-outline-light my-5 py-3" style={{width: "130px"}} onClick={setTimer(5)}> 5 Minutes</button>
                </div>
                <div className="row justify-content-center my-5">
                    <button className="btn btn-lg btn-outline-light my-5 py-3" style={{width: "130px"}} onClick={setTimer(10)}>10 Minutes</button>
                </div>
                <div className="row justify-content-center mt-0">
                  <button className="btn btn-lg btn-outline-light mt-5 py-3" style={{width: "130px"}} onClick={setTimer(15)}>15 Minutes</button>
                </div>
            </div>
            <div className="col offset-0 align-self-end">
                  <div className="row justify-content-center" >
                    <div className= "col-0 mb-4" style={{height:"115px"}}>
                      <button className="btn btn-outline-light h-100 rounded-circle img-fluid py-4 px-4" onClick={toggle}>{playing ? <img className=" h-100 rounded-circle img-fluid " src={pauseButton} alt=""></img> : <img className=" h-100 rounded-circle img-fluid " src={playButton} alt=""></img>}</button>
                    </div>
                  </div>
                  <div className="row justify-content-center mt-5">
                    <div className= "col-0 offset-0">
                      <h3 className="text-white h1 mb-0 mt-5">{mm}:{ss}</h3>
                    </div>
                  </div>
            </div>
            <div className="col offset-0 mt-5 align-self-center mr-1">
              <div className="row justify-content-center">
                <div className= "col-0 offset-0" style={{height:"115px"}}>
                  <button className="btn btn-outline-light border border-white h-100 rounded-circle img-fluid py-4 px-4" onClick={onClickRain}><img className=" h-100  img-fluid" src={rainLogo} alt=""></img></button>
                </div>
              </div>
              <div className="row justify-content-center mt-5">
                <div className= "col-0 offset-0" style={{height:"115px"}}>
                  <button className="btn btn-outline-light border border-white h-100 rounded-circle img-fluid py-4 px-4 mt-5" onClick={onClickBeach}><img className=" h-100  img-fluid" src={sunnyLogo} alt=""></img></button>
                </div>
              </div>
            </div>
          </div>
        </div>
    </div>


  )}

export default Bonus;
